import axios from 'axios';
const KEY = 'AIzaSyCjqs520IEykQgLHEvpCRX6MePyGEwRt_k';


// Create new instance of axios for handleing
export default axios.create({
    baseURL: 'https://www.googleapis.com/youtube/v3/',
    params: {
        part: 'snippet',
        maxResults: 4,
        key: KEY,
        type: 'video'
    }
})
